<script setup>
const mainMap = ref(null);

const emit = defineEmits(["handleClick"]);
const activeCountry = defineModel({
  activeCountry: {
    type: String,
  },
});

onMounted(() => {
  const svgMap = document.getElementById("mainMap");
  svgMap.addEventListener("click", (event) => {
    const clickedElement = event.target.previousSibling;
    if (clickedElement?.tagName === "path") {
      const pathId = clickedElement.id;
      activeCountry.value = pathId;
      emit("handleClick", pathId);
    }
  });
});
</script>

